Universal Serial Bus (USB) é um tipo de conexão "ligar e usar" que permite a fácil conexão de periféricos sem a necessidade de desligar o computador. Antigamente, instalar periféricos em um computador obrigava o usuário a abrir a máquina, o que para a maioria das pessoas era uma tarefa quase impossível pela quantidade de conexões internas, que muitas vezes eram feitas através de testes perigosos para o computador, sem falar que na maioria das vezes seria preciso configurar jumpers e interrupções IRQs, tarefa difícil até para profissionais da área. O surgimento do padrão PnP (Plug and Play ou ligar e usar) diminuiu toda a complicação existente na configuração desses dispositivos. O objetivo do padrão PnP foi tornar o usuário sem experiência capaz de instalar um novo periférico e usá-lo imediatamente sem mais delongas. Mas esse padrão ainda era suscetível a falhas, o que causava dificuldades para alguns usuários. O USB Implementers Forum foi concebido na óptica do conceito de Plug and Play, revolucionário na altura da expansão dos computadores pessoais, feito sobre um barramento que adota um tipo de conector que deve ser comum a todos os aparelhos que o usarem, assim tornando fácil a instalação de periféricos que adotassem essa tecnologia, e diminuiu o esforço de concepção de periféricos, no que diz respeito ao suporte por parte dos sistemas operacionais (SO) e hardware. Assim, surgiu um padrão que permite ao SO e à placa-mãe diferenciar, transparentemente: 
*  A classe do equipamento (dispositivo de armazenamento, placa de rede, placa de som, etc); 
*  As necessidades de alimentação elétrica do dispositivo a uma distância de ate 5 metros sem a necessidade de outro equipamento, caso este não disponha de alimentação própria; 
*  As necessidades de largura de banda (para um dispositivo de vídeo, serão muito superiores às de um teclado, por exemplo); 
*  As necessidades de latência máxima; 
*  Eventuais modos de operação internos ao dispositivo (por exemplo, máquina digital pode operar, geralmente, como uma webcam ou como um dispositivo de armazenamento - para transferir as imagens). Ainda, foi projetado de maneira que possam ser ligados vários periféricos pelo mesmo canal (i.e., porta USB). Assim, mediante uma topologia em árvore, é possível ligar até 127 dispositivos a uma única porta do computador, utilizando, para a derivação, hubs especialmente concebidos, ou se, por exemplo, as impressoras ou outro periféricos existentes hoje tivessem uma entrada e saida USB, poderíamos ligar estes como uma corrente de até 127 dispositivos, um ligado ao outro, os quais o computador gerenciaria sem nenhum problema, levando em conta o tráfego requerido e velocidade das informações solicitadas pelo sistema. Estes dispositivos especiais (os hubs anteriormente citados) - estes também dispositivos USB, com classe específica -, são responsáveis pela gestão da sua subárvore e cooperação com os nós acima (o computador ou outros hubs). Esta funcionalidade foi adaptada da vasta experiência em redes de bus, como o Ethernet - o computador apenas encaminhará os pacotes USB (unidade de comunicação do protocolo, ou URB, do inglês Uniform Request Block) para uma das portas, e o pacote transitará pelo bus até ao destino, encaminhado pelos hubs intermediários.
